package main

import "fmt"

func serialize(t *TreeNode) string {
	if t == nil {
		return ""
	}
	var bs = make([]byte, 0)
	bfs([]*TreeNode{t}, &bs)
	return string(bs)
}

func bfs(ts []*TreeNode, res *[]byte) {
	var nts = make([]*TreeNode, 0)
	for _, t := range ts {
		if t != nil {
			nts = append(nts, t.left, t.right)
			*res = append(*res, []byte(fmt.Sprintf("%v", t.val))...)
		}
		*res = append(*res, ',')
	}
	if len(nts) > 0 {
		bfs(nts, res)
	}
	var i int
	for i = len(*res) - 1; i >= 0; i-- {
		if (*res)[i] != ',' {
			break
		}
	}
	(*res) = (*res)[:i+2]
}

func readNum(s string) (*TreeNode, string) {
	if len(s) == 0 {
		return nil, s
	}
	var (
		bs   = make([]byte, 0)
		sign = 1
		ok   bool
		i, r int
	)
	if s[i] == '-' {
		sign = -1
		i++
	}
	for i = i; i < len(s); i++ {
		if s[i] == ',' {
			i++
			break
		}
		ok = true
		bs = append(bs, s[i])
	}
	var d = 1
	for j := len(bs) - 1; j >= 0; j-- {
		r += int(bs[j]-'0') * d
		d *= 10
	}
	if !ok {
		return nil, s[i:]
	}
	return &TreeNode{r * sign, nil, nil}, s[i:]
}

func deserialize(s string) *TreeNode {
	var root *TreeNode
	root, s = readNum(s)
	if root == nil {
		return nil
	}
	var nodes = []*TreeNode{root}
	for len(nodes) > 0 && len(s) > 0 {
		var nns = make([]*TreeNode, 0)
		for i := range nodes {
			nodes[i].left, s = readNum(s)
			nodes[i].right, s = readNum(s)
			if nodes[i].left != nil {
				nns = append(nns, nodes[i].left)
			}
			if nodes[i].right != nil {
				nns = append(nns, nodes[i].right)
			}
		}
		nodes = nns
	}
	return root
}

